@Naı mā فعلا هذا الكلام صحيح ولكن كما قلت أنها " تصرفات فردية لكن منتشرة " .
أنا كنت أيضا فتى بريء 😂 يذهب في طريقه ويلاحظ كل يوم وجود المئات من الشباب في المقاهي وأمام المدارس وفي مداخل الجامعة وهم ليسوا طلابا وأتساءل ببراءة كيف يمكن لهم أن يقضون الوقت كله هكذا ولكن لو وجد هؤلاء القلة القلائل ما يقومون به لو عندهم محاضرات أو تدريب معين أو مهنة أو شيء نافع يملأ الوقت لما شاهدنا هذا الظواهر  وأنا هنا لا أبرر التحرش فهو فكرة قذرة وهو تعدي على حرية الناس أيا يكن اللباس الذي ترتديه الفتاة فهو ليس مبرر ، ( نسمع دائما : " لو كانت محتشمة لما .... وهي متبرجة والذباب الذي يحط على ال.. المكشوف وأفكار لا أدري ما هو أساسها )  هذه حرية شخصية وليس من حقنا مقاضاة الناس على لباسهم .
كيف لنا أن نبرر التحرش ببنات بلدنا أنهم لايرتدون على الشريعة ولا نتجرأ على القيام بهذا الفعل عندما نكون في أوروبا حيث التعري ثقافة ؟

