@sim sali انا نجاوبك.. هي صحيح لم تسب فئة الشعب الذي وقف معها وساندها.. ولكن هذا لا يعني أنها لم تسب وتقصد بذلك السب الناس لي طعنت فيها ولم تساندها.. إذن فليس هناك أي تناقض.. فليس من المعقول أيضا أن تقول أنه صوتي وأني أنا من سببت وكنت أقصد بالسب الناس لي ضدي وهبلوني في لحظة غضب.. 
فلو قالت ذلك ستفقد مكانتها وصورتها البريئة وستصبح تلك البنت المتفحشة وبذيئة اللسان مثل بنات الشارع.. وهذا طبعا لن يخدمها مع الشعب او عملها مع القنوات..
لذلك فلا مخرج لها إلا الإنكار على قول المثل: معزة ولو طارت..

